import Navbar from "../../components/navbar";

const About = () => {
    return (
        <div>
            <Navbar />
                <div className="py-10 bg-white mt-[120px] mx-[30%] rounded">
                <h1 className="text-center text-3xl font-medium">About Me</h1>
                <p>I'm from Indonesia and full</p>
                </div>
        </div>
    )
}
export default About;
